import React from 'react';
import { useLocation } from 'react-router-dom';
import './Exportpage.css';  // Assuming the background CSS is in this file

function Exportpage() {
    const location = useLocation();
    const { mergedAudio } = location.state || {};

    return (
        <div className="pagebackground">
            <h1>Exported Audio</h1>
            {mergedAudio ? (
                <audio controls>
                    <source src={mergedAudio} type="audio/wav" />
                    Your browser does not support the audio element.
                </audio>
            ) : (
                <p>No audio available.</p>
            )}
        </div>
    );
}

export default Exportpage;
